column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。2014年から復活発売されたランドクルーザー76/79にも装着可能な<br>
リアシート左右ドアに装着できる<br>
カップホルダー兼携帯電話ホルダーです<br>
従来型76/77/78プラドにも装着可能です。<br>
左右ドアのウィンドウモール部分に引っ掛け<br>
下側の支えは両面テープで内張りに貼り付け固定です。<br>
復活76/79純正シート仕様では、<br>
運転席 助手席のリクライニングも可能。<br>
76/77はリアシートの折りたたみも可能です。<br>
お好みにより、コルクタイプの<br>
コースターを装着できます。<br>
ブラック仕上げのみ。<br>
蓋が開いた中身が入った状態のドリンクを装着状態で<br>
ドアの開閉は避けてください。<br>
送料区分 ： 120<!-- ここから リア受 -->
